import React, { useState } from 'react';
import Navbar from '../components/Navbar';
import HeroSection from '../components/HeroSection';
import { Parallax } from 'react-parallax';
import bgImage from '../assets/home_bg.png'

const Home = () => {

  //nav hamburger
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => {
      setIsOpen(!isOpen);
  };

  const Container = () => (
    <Parallax blur={10} bgImage={bgImage} bgImageAlt="CURIS Team" strength={200}>
    <div className = "parallax_content">
      <p>"Our mission is to advocate <b>to improve</b> public health in the local community through education, outreach, and practical solutions."</p>
    </div>
    </Parallax>
);

  return (
    <>
      <Navbar toggle={toggle} />
      <div className="hero">
        <HeroSection/>
      </div>
      <div className = "parallax_content">
        <p>"Our mission is to advocate <b>to improve</b> public health in the local community through education, outreach, and practical solutions."</p>
      </div>
      <Container />
    </>
  );
};

export default Home;
